  //               }
  //           })
  //           .then((res) => {
  //               const { BASE_AGREGADOS } = res.data.RESPOSTA
  //               console.log(BASE_AGREGADOS)
  //               setResporta(BASE_AGREGADOS)
  //           })
  //           .catch((err) => {
  //               console.log(err)
  //           })
  // }

  const handleNext = () => {
    if ((activeStep === 0) && (dado === '')) {
      console.log('Placa vazia')
    } else {
      console.log('Placa preenchida');
      setActiveStep((prevActiveStep) => prevActiveStep + 1);
      // ConsultaPlaca(dado)
    }
  };

  const handleBack = () => {
    setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const handleReset = () => {
    setActiveStep(0);
  };

  const Passo1 = () => {
    return(
        <div className='placa--input'>
          <TextField type='text' id='placa' name='placa' onChange={(e) => setDado(e.target.value)} label='Placa' size='small' defaultValue={dado} fullWidth/>
          <p>*Digite a placa e clique em PRÓXIMO</p>
        </div>
    )
  }
  
